import React from 'react';
import { useParams } from 'react-router-dom';

const FundDetailsPage = () => {
  const { id } = useParams();
  return (
    <div className="p-4">
      <h2 className="text-xl font-bold">Fund Details for ID: {id}</h2>
    </div>
  );
};

export default FundDetailsPage;
